let showPrevBtn = document.getElementById('prev-img');
let showNextBtn = document.getElementById('next-img');
let slideImge = document.getElementById('slide-img');


showPrevBtn.addEventListener('click', onShowPrevBtn);
showNextBtn.addEventListener('click', onShowNextBtn);

let imgsUrls = [];
    imgsUrls.push('data:image/png;base64,');    
    imgsUrls.push('data:image/png;base64,');
    imgsUrls.push('data:image/jpeg;base64,');
    imgsUrls.push('data:image/jpeg;base64,');

    let currenImageIndex = 0;
    slideImge.src = imgsUrls[currenImageIndex];

    showPrevBtn.disabled = true;
    

function onShowPrevBtn(){
    currenImageIndex--;
    slideImge.src = imgsUrls[currenImageIndex];
    showNextBtn.disabled = false;
    if (currenImageIndex === 0){
        showPrevBtn.disabled = true;
    }
    
}
function onShowNextBtn(){
    currenImageIndex++;
    slideImge.src = imgsUrls[currenImageIndex];
    showPrevBtn.disabled = false;
    if (currenImageIndex === (imgsUrls.length-1)){
        showNextBtn.disabled = true;
    }
    slideImge.src = imgsUrls[currenImageIndex];
}


